ISLAMABAD, Dec 20 (APP):Special Assistant to the Prime Minister on Political Communication Dr Shahbaz Gill on Monday congratulated Shaukat Tareen on his election as Senator.
“No doubt Shaukat Tareen is a fearless and patriotic Pakistani. May Allah help him to serve our beloved homeland,” he tweeted.
